import 'react-chat-widget/lib/styles.css';
import ChatWidget from './components/ChatWidget';
const buttons = [{ label: 'first', value: '1' }, { label: 'second', value: '2' }];
const App = () => {

  return (
    <Router>
      <React.Fragment>
        <ul>
          <li>
            <Link to='/'>Client Home</Link>
          </li>
        </ul>
        <hr />
        <Route exact path='/' component={ChatWidget} />
      </React.Fragment>
    </Router>
  );
}

export default App
